import React from "react";
import { Switch, Route, Link, Router } from "react-router-dom";
import "./App.css";
import Signin from "./pages/auth/login";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" component={Signin}></Route>
          <Signin></Signin>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
